B.a7S=new A.ad(B.eb,["Rouget (Erysip\xe8le)","Aretina bakteria (Erysipelothrix). Mety ho mafy na mitaiza. Azo sitranina.","\u2022 Fanaviana mafy\n\u2022 Pentina diamant amin'ny hoditra (Carr\xe9s rouges)\n\u2022 Tsy te-hitsangana\n\u2022 Vonton'ny tonon-taolana (Arthrite)","\u2022 P\xe9nicilline (Tena mahomby)\n\u2022 Amoxicilline\n\u2022 Tsindrona intelo isan'andro, 3-5 andro","\u2022 Tongolo gasy (Fisorohana)\n\u2022 Fampangatsiahana ny vatana amin'ny rano matimaty","\u2022 Tsaboina avy hatrany\n\u2022 Atokana ny marary","\u2022 Vaksiny Rouget isaky ny 6 volana\n\u2022 Fahadiovana"],t.w)
B.a7L=new A.ad(B.eb,["Fivalanana (Diarrh\xe9e)","Aretina mahazatra amin'ny kisoa kely. Mety vokatry ny bakteria (E.coli, Salmonella) na virus.","\u2022 Mivalana ranony na fotsy\n\u2022 Marary kibo\n\u2022 Reraka, tsy homana\n\u2022 Mihena haingana ny lanja","\u2022 R\xe9hydratation (Rano + Sira + Siramamy)\n\u2022 Antibiotique (Colistine, Sulfamides)\n\u2022 Probiotique","\u2022 Rano nampangotrahina sy vary aron-tsira\n\u2022 Charbon de bois voatoto","\u2022 Omena rano matetika\n\u2022 Diovina ny trano\n\u2022 Hafanaina ny kisoa kely","\u2022 Fahadiovana\n\u2022 Hafanana (26-28\xb0C ho an'ny kely)\n\u2022 Tsindrona Fer J-3"],t.w)
B.a7Q=new A.ad(B.eb,["Pneumonie (Aretitratra)","Fivontosana ny havokavoka, matetika vokatry ny hatsiaka na vovoka.","\u2022 Mikohaka, mikorina\n\u2022 Miaina mafy (Sempo)\n\u2022 Fanaviana\n\u2022 Tsy te-homana\n\u2022 Mitombo miadana","\u2022 Antibiotique (Tylosine, Florf\xe9nicol, Tilmicosine)\n\u2022 Anti-inflammatoire","\u2022 Tantely sy tongolo gasy\n\u2022 Inhalation: fampanehana etona kininina","\u2022 Hafanaina ny trano\n\u2022 Ahena ny vovoka","\u2022 Ventilation tsara (tsy miditra rivotra mivantana)\n\u2022 Tsy atao mifanizina loatra"],t.w)
B.a7R=new A.ad(B.eb,["Mange (Gale - Lagaly)","Aretina hoditra vokatry ny Sarcoptes (katsentsitra). Tena manelingelina ny kisoa.","\u2022 Mangidihidy mafy\n\u2022 Mihintsana ny volo\n\u2022 Hoditra matevina, misy kilema\n\u2022 Mikasokasoka hatrany\n\u2022 Mihena ny fitomboana","\u2022 Ivermectine (Tsindrona na Pour-on)\n\u2022 Averina afaka 14 andro","\u2022 Menaka coco sy soufre\n\u2022 Lavenona (Cendre) ahosotra","\u2022 Tsaboina ny kisoa rehetra miaraka\n\u2022 Diovina ny trano","\u2022 Ivermectine isan'3 volana\n\u2022 Fahadiovana"],t.w)
